import React from "react";
import {
    Typography,
    Button,
    Container,
    Grid
} from "@material-ui/core";

class FileItem extends React.Component {
    render() {
        return (
            <Grid item>
                        <Typography>Name</Typography>
                    </Grid>
        )
    }
}

export default FileItem;
